import React, { useState } from "react";
import { useAuth0 } from "@auth0/auth0-react";
import { FaBars } from "react-icons/fa";
import {
  Nav,
  NavLink,
  NavMenu,
  Logo,
  MenuIcon,
  NavItem,
  MobileNavMenu,
  MobileNavItem,
  AuthButton,
} from "./NavbarStyle";

function Navbar() {
  const { user, isAuthenticated, loginWithRedirect, logout } = useAuth0();
  const [showMenu, setShowMenu] = useState(false);

  const logoutWithRedirect = () =>
    logout({
      logoutParams: {
        returnTo: window.location.origin,
      },
    });

  const handleMenuToggle = () => {
    setShowMenu(!showMenu);
  };

  return (
    <>
      <Nav>
        <Logo to="/" />
        <MenuIcon onClick={handleMenuToggle}>
          <FaBars />
        </MenuIcon>
        <NavMenu>
          <NavItem>
            <NavLink to="/" exact>
              Home
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/product">Product</NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/about">About</NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/blog">Blog</NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/contact">Contact</NavLink>
          </NavItem>
        </NavMenu>
        <MobileNavMenu showMenu={showMenu}>
          <MobileNavItem>
            <NavLink to="/" exact onClick={handleMenuToggle}>
              Home
            </NavLink>
          </MobileNavItem>
          <MobileNavItem>
            <NavLink to="/product" onClick={handleMenuToggle}>
              Product
            </NavLink>
          </MobileNavItem>
          <MobileNavItem>
            <NavLink to="/about" onClick={handleMenuToggle}>
              About
            </NavLink>
          </MobileNavItem>
          <MobileNavItem>
            <NavLink to="/blog" onClick={handleMenuToggle}>
              Blog
            </NavLink>
          </MobileNavItem>
          <MobileNavItem>
            <NavLink to="/contact" onClick={handleMenuToggle}>
              Contact
            </NavLink>
          </MobileNavItem>
        </MobileNavMenu>
        {isAuthenticated ? (
          <NavItem>
            <AuthButton onClick={logoutWithRedirect}>Logout</AuthButton>
          </NavItem>
        ) : (
          <NavItem>
            <AuthButton onClick={loginWithRedirect}>Log in</AuthButton>
          </NavItem>
        )}
      </Nav>
    </>
  );
}

export default Navbar;
